/** @format */

import React from 'react';
import { Link } from 'react-router-dom';

export default function Header({ isLogined }) {
  return (
    <header className='fixed'>
      <nav className='flex gap-5 p-3'>
        <div>
          <Link to={'/'}>홈</Link>
        </div>

        <div>
          {isLogined ? (
            <button>로그아웃</button>
          ) : (
            <>
              <Link to={'/login'}>로그인</Link>
              <Link to={'/join'}>회원가입</Link>
            </>
          )}
        </div>
      </nav>
    </header>
  );
}
